import React from 'react';
import style from './recipe.model.css';

const Recipe=({title,calories,image,ingredients})=>{
    return(
        <div>
            <h1 className={style.recipe}>{title}</h1>
            <ol>
                {ingredients.map(ingredient=>(
                    <li>
                        {ingredient.text}
                    </li>
                ))}
            </ol>

            <p>{calories}</p>
            <img src={image} alt=""/>
        </div>
    );
}

export default  Recipe;
